-- create database

create database app with template template_postgis;
create user app with password 'app';
\c app

-- fill with some data

SET CLIENT_ENCODING TO UTF8;
SET STANDARD_CONFORMING_STRINGS TO ON;
BEGIN;
CREATE TABLE "road" (gid serial PRIMARY KEY,
"osm_id" numeric(11,0),
"name" varchar(48),
"ref" varchar(16),
"type" varchar(16),
"oneway" int2,
"bridge" int2,
"maxspeed" int2);
SELECT AddGeometryColumn('','road','geometry','4326','MULTILINESTRING',2);


END;

-- rights...

grant all ON DATABASE app to app;
grant all on table road to app;
